  false,\n\t\"url\": null,\n\t\"notes\": \"Using a LH Systems ALS50 Light Detection
  And Ranging (LiDAR) system, flight lines of standard density (1.4 meter ground sample
  distance) data were collected over areas in San Patricio County, TX (approximately
  705 square miles). Multiple returns were recorded for each laser pulse along with
  an intensity value for each return. The data acquisition occurred in 6 missions
  between July 10, 2006, and July 15, 2006. The data was collected by Sanborn Mapping
  Company, Inc. for the Texas Water Development Board (TWDB) and the Federal Emergency
  Management Agency (FEMA).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
